import React from 'react';
import './CreatedEvents.css';
import '../HomeLayout/HomeLayout.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';
import ListItem from '../../Common/ListItem/ListItem';
import Link, {NavLink} from 'react-router-dom';

class CreatedEvents extends React.Component {

    render() {
        return (
        <div className="container-fluid">
            <div className="container-fluid, homeContainer">
                <div className="row, homeTitle">
                    <h3><b>CREATED EVENTS<NavLink to="/home/createEvent"><button type="button" class="btn" id="addEventBtn"><FontAwesomeIcon icon={faPlus} /></button></NavLink></b></h3>        
                </div>
                <form id="contactForm">
                    <div className="form-group">
                        <input type="email" class="form-control" id="contactEmail" aria-describedby="enterEmail" placeholder="Your Email"></input>
                    </div>
                    <div className="form-group">
                        <input type="text" class="form-control" id="contactSubject" placeholder="Subject Line"></input>
                    </div>
                    <div className="form-group">
                        <textarea class="form-control" id="contactMessage" rows= "10" placeholder="Type your message"></textarea>
                    </div>
                    <button type="submit" class="btn btn-primary" className="submitBtn">SUBMIT</button>
                </form>
            </div>
        </div>
        )
    }
}

export default CreatedEvents;
